// mock data until backend is built
const DATA = {
  progams: [
    {
      id: 1,
      rest_duration: 3,
      name: "My Fave :)",
      days: [
        {
          id: 112,
          cardio: {
            name: "running",
            duration: 15,
          },
          workouts_needed: [
            {
              workout_name: ["Bench Press"],
              goal: [
                {
                  sets: 3,
                  min_reps: 6,
                  max_reps: 8,
                },
              ],
              muscles_worked: ["chest"],
            },
          ],
        },
      ],
    },
  ],
};
