        return <SelectDay />;
      case 3:
        return <SelectWorkout />;
      case 4:
        return <Rest />;
      case 5:
        return <PerformWorkout />;
      default:
    }
  };
  return (
    <div>
      hello workout page - main
      {renderCurrentStep()}
    </div>
  );
};
